import React, {useState} from "react";
import Base from "../core/Base";

import {Link} from "react-router-dom";

const Signin = () => {

    const [values, setValues] = useState({
        email: "",
        password: "",
        loading: false,
        didRedirect: false
    });

    const {email, password,loa} = values;

        const signInForm = () => {

        return(
            <div className="row">
                <div className="col-md-6 offset-sm-3 text-left">
                    <form>
                        <div className="form-group">
                            <label className="text-light">Email</label>
                            <input value={email} className="form-control" type="email" />
                        </div>
                         <div className="form-group">
                            <label className="text-light">Password</label>
                            <input value={password} className="form-control" type="password" />
                        </div>
                        <br/>
                             <button onClick={onSubmit} className="btn btn-success btn-lg btn-block form-control">Submit</button>
                    </form>
                </div>
            </div>
        )
    }

    return (
        <Base title = "Sign up Page" description="A page for user to Sign in!">
            {signInForm()}
        </Base>
    );
};

export default Signin;
